  \"Factors influencing furbearer populations and harvest on the Kenai National Moose
  Range, Alaska\",\n\t\"tracking_summary\": {\n\t\t\"total\": 6,\n\t\t\"recent\":
  1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2016-07-27T23:02:22.989676\",\n\t\"name\": \"factors-influencing-furbearer-populations-and-harvest-on-the-kenai-national-moose-range-al\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Natural factors have influenced several
  furbearer populations on the 691,000 ha Kenai National Moose Range wildlife refuge
  in southcentral Alaska. The 1964 earthquake which suddenly disturbed refuge hydrology
  apparently caused a major decline in the refuge beaver (Castor canadensis) population.
  A history of wildfires appear related to the scarcity of marten (Martes americana)
  on the refuge and perhaps the relatively low beaver population. Browsing of aspen
  (Populus tremuloides) by high populations of moose (Alces alces) may also have influenced
  the refuge beaver population. A lynx (Lynx canadensis) harvest increase of 40 times
  between 1966-67 and 1973-74 apparently paralleled changes in snowshoe hare (Lepus
  americanus) abundance. Furbearer harvest on the refuge is related to fur prices,
  the local economy, trapper experience and technique, and mode of transportation.
  A u201ctrackingu201d harvest strategy is recommended for harvesting certain furbearer
  populations on the refuge.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
